import Link from '@material-ui/core/Link';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Title from './Title';
import React, { useState, useEffect } from 'react';
import axios from 'axios';


// Generate Order Data
function createData(id, date, name, paymentMethod, amount) {
  return { id, date, name, paymentMethod, amount };
}

const rows = [
  createData(0, '16 Mar, 2023', 'Elvis Presley', 'VISA ⠀•••• 3719', '$ 312.44'),
  createData(1, '16 Mar, 2023', 'Paul McCartney', 'VISA ⠀•••• 2574', '$ 866.99'),
  createData(2, '16 Mar, 2023', 'Tom Scholz', 'MC ⠀•••• 1253', '$ 100.81'),
  createData(3, '16 Mar, 2023', 'Michael Jackson', 'AMEX ⠀•••• 2000', '$ 654.39'),
  createData(4, '15 Mar, 2023', 'Bruce Springsteen', 'VISA ⠀•••• 5919', '$ 212.79'),
];

function preventDefault(event) {
  event.preventDefault();
}

const useStyles = makeStyles((theme) => ({
  seeMore: {
    marginTop: theme.spacing(3),
  },
}));

export default function Orders() {
  const classes = useStyles();
  return (
    <React.Fragment>
  <Title>Citas Recientes</Title>
  <Table size="small">
    <TableHead>
      <TableRow>
        <TableCell>Fecha</TableCell>
        <TableCell>Nombre</TableCell>
        <TableCell>Identification</TableCell>
        <TableCell>Teléfono</TableCell>
        <TableCell>Birthday</TableCell>
        <TableCell>Género</TableCell>
        <TableCell>Email</TableCell>
        <TableCell>Provincia</TableCell>
        <TableCell>Cantón</TableCell>
        <TableCell>Distrito</TableCell>
        <TableCell>Imagen</TableCell>
        <TableCell>Rol</TableCell>
        <TableCell align="right">Acción</TableCell>
      </TableRow>
    </TableHead>
    <TableBody>
      {users.map((user) => (
        <TableRow key={user._id}>
          <TableCell>{user.date}</TableCell>
          <TableCell>{user.name}</TableCell>
          <TableCell>{user.identification}</TableCell>
          <TableCell>{user.phone}</TableCell>
          <TableCell>{user.birthday}</TableCell>
          <TableCell>{user.gender}</TableCell>
          <TableCell>{user.email}</TableCell>
          <TableCell>{user.province}</TableCell>
          <TableCell>{user.canton}</TableCell>
          <TableCell>{user.distrit}</TableCell>
          <TableCell>{user.img}</TableCell>
          <TableCell>{user.role}</TableCell>
          <TableCell align="right">
            <Link to={`/update/${user._id}`} color="primary" onClick={preventDefault}>
              Actualizar
            </Link>
            <Link to={`/delete/${user._id}`} color="secondary" onClick={preventDefault}>
              Eliminar
            </Link>
          </TableCell>
        </TableRow>
      ))}
    </TableBody>
  </Table>
  <div className={classes.seeMore}>
    <Link color="primary" href="#" onClick={preventDefault}>
      Ver más citas
    </Link>
  </div>
</React.Fragment>
  );
}
